html {
  font-size: 10px;
}
body {
  background: #fff;
  color: #000;
  font-weight: 500;
  font-size: 1.4rem;
  font-family: "Raleway", Arial, sans-serif;
  letter-spacing: 0.8px;
}
a {
  color: #3085a3;
  text-decoration: none;
}
a:hover,
a:focus {
  color: #000000;
}
img {
  max-width: 100%;
}
.capÃ§alera {
  padding: 20px;
  background-color: #fff;
}
.menu {
  margin-top: 20px;
  float: right;
}
.menu a {
  color: #000;
  letter-spacing: 0.5px;
  font-size: 1.3rem;
}
.menu ul {
  padding-left: 0;
}
.menu li {
  display: inline-block;
  padding: 10px 10px 10px 0px;
  text-transform: uppercase;
  font-weight: 800;
}
.submenu {
  position: relative;
}
.elementsSubmenu {
  padding-top: 10px;
  right: -40px;
  display: none;
  position: absolute;
  background-color: #f1f1f1;
  min-width: 250px;
  border-top: 2px solid #3085a3;
  z-index: 1;
  top: 50px;
}
.elementsSubmenu:before {
  position: absolute;
  content: "";
  left: 60%;
  top: -12px;
  width: 0;
  height: 0;
  border-style: solid;
  border-width: 0 7.5px 12px 7.5px;
  border-color: transparent transparent #3085a3 transparent;
}

.elementsSubmenu a {
  padding: 10px 10px 10px 20px;
  border-left: 4px solid transparent;
}
.elementsSubmenu a:hover {
  border-left: 4px solid #3085a3;
}
.mostra {
  display: block;
}
.menu a.iconTwitter,
.menu a.iconFacebook {
  vertical-align: middle;
}
.menu a.iconTwitter:hover {
  color: rgb(34, 151, 187);
}
.menu a.iconFacebook:hover {
  color: #3b5998;
}

.sec_home h1 {
  font-weight: 800;
}
section,
article {
  margin-top: 5rem;
  margin-bottom: 8rem;
}

article h2,
article strong,
.text-upper {
  text-transform: uppercase;
  font-size: 1.3rem;
}
article h2 {
  font-weight: bold;
}

article .row {
  margin-bottom: 3rem;
}

article .row > div {
  margin-bottom: 2rem;
}

pre {
  white-space: pre-wrap;
  word-wrap: break-word;
}

footer {
  margin-top: 120px;
  font-size: 12px;
  padding: 50px 0px 20px;
}

.fotoheader {
  padding-top: 50px;
  padding-bottom: 50px;
}
.titol-header {
  position: relative;
  padding-top: 100px;
  padding-bottom: 100px;
  font-size: 4em;
  font-weight: 300;
  color: #fff;
  text-align: center;
}
.titol-header span {
  font-weight: 800;
}
.sec_item .titol-header {
  padding-top: 50px;
  padding-bottom: 50px;
  font-size: 2em;
}

.titol-sec {
  clip-path: polygon(0 10%, 100% 0, 100% 90%, 0 100%);
}

.cat_icon .titol-sec {
  background: url(../img/harpal-singh-_zKxPsGOGKg-unsplash_gran.jpg) no-repeat
    center center scroll;
  background-size: cover;
}
.cat_css .titol-sec {
  background: url(../img/florian-olivo-4hbJ-eymZ1o-unsplash_gran.jpg) no-repeat
    center center scroll;
  background-size: cover;
}

.categories figure {
  display: inline-block;
  overflow: hidden;
  margin: -3px -2px;
  padding-left: 0px;
  height: 300px;
  background: #3085a3;
  text-align: center;
}
.categories figure img {
  max-width: none;
  opacity: 0.9;
  transition: opacity 0.5s;
}
.categories figure figcaption {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  padding: 3em;
  color: #fff;
  text-transform: uppercase;
  font-size: 1.25em;
}
.categories figure figcaption::before,
.categories figure figcaption::after {
  position: absolute;
  top: 30px;
  right: 30px;
  bottom: 30px;
  left: 30px;
  content: "";
  opacity: 0;
  transition: opacity 0.5s, transform 0.5s;
}
.categories figure figcaption::before {
  border-top: 1px solid #fff;
  border-bottom: 1px solid #fff;
  transform: scale(0, 1);
}
.categories figure figcaption::after {
  border-right: 1px solid #fff;
  border-left: 1px solid #fff;
  transform: scale(1, 2);
}
.categories figure h2 {
  font-size: 3rem;
  font-weight: 300;
  padding-top: 30%;
  transition: transform 0.5s;
  transform: translate3d(0, -20px, 0);
}
.categories figure h2 span {
  font-weight: 800;
}
.categories figure p {
  letter-spacing: 1px;
  font-size: 1.4rem;
  opacity: 0;
  transition: opacity 0.5s, transform 0.5s;
  transform: translate3d(0, 20px, 0);
}
.categories figure:hover img {
  opacity: 0.1;
}
.categories figure:hover figcaption::before,
.categories figure:hover figcaption::after {
  opacity: 1;
  transform: scale(1);
}
.categories figure:hover h2,
.categories figure:hover p {
  opacity: 1;
  transform: translate3d(0, 0, 0);
}

.cat-items > div {
  margin-bottom: 30px;
  font-size: 2rem;
  font-weight: 500;
}

.cat-items figcaption {
  padding-top: 15px;
}

.cat-items img {
  max-height: 70px;
}

.cat-items a {
  position: relative;
}

.cat-items a:before {
  content: "";
  position: absolute;
  opacity: 0;
  bottom: -3px;
  left: 0;
  width: 0;
  height: 2px;
  background: #3085a3;
  -webkit-transition: 0.3s;
  -moz-transition: 0.3s;
  transition: 0.3s;
}

.cat-items a:hover {
  text-decoration: none;
}

.cat-items a:hover::before {
  width: 100%;
  opacity: 1;
}

.header-item {
  margin-top: 40px;
  margin-bottom: 30px;
  border-bottom: 2px solid #3085a3;
}
.sec_item h1 {
  font-weight: 300;
  font-size: 4rem;
}
.sec_item h1 strong {
  font-weight: 800;
}
.sec_item .fotos {
  margin-top: 40px;
}
.sec_item .fotos img {
  margin-bottom: 20px;
  margin-top: 20px;
}
.sec_item .items-nav {
  text-align: right;
  margin-top: 20px;
}
.tornarcataleg {
  padding: 0 10px;
}
.sec_item .text {
  margin-bottom: 30px;
}

footer {
  background: #f5f5f6;
}
ul#menuSubmenuFooter {
  padding-left: 0px;
}
#menuSubmenuFooter li {
  list-style: none;
}
#menuSubmenuFooter li a {
  color: #000;
}

.tornar {
  text-align: center;
  letter-spacing: 2px;
  font-weight: 600;
  font-size: 14px;
  padding: 40px 10px;
}
.tornar a {
  color: #000;
}

#footer-clip {
  width: 200px;
  height: 200px;

  --clip-path: polygon(
    70% 0,
    40% 100%,
    30% 100%,
    60% 0,
    60% -5%,
    -5% -5%,
    -5% 50%,
    0 50%,
    30% 30%,
    30% 40%,
    15% 50%,
    30% 60%,
    30% 70%,
    0 50%,
    -5% 50%,
    -5% -5%,
    -5% 105%,
    105% 105%,
    100% 50%,
    70% 30%,
    70% 40%,
    85% 50%,
    70% 60%,
    70% 70%,
    100% 50%,
    105% 50%,
    105% 105%,
    -5% 105%,
    -5% -5%
  );

  -webkit-clip-path: var(--clip-path);
  clip-path: var(--clip-path);

  content: "";
  position: absolute;
  top: -90px;
  right: 0px;
  bottom: 0;

  background: #fff;
}
#sombraclip {
  filter: drop-shadow(-1px 6px 3px rgba(50, 50, 0, 0.3));
}

@media (max-width: 768px) {
  .titol-header {
    font-size: 4rem;
  }
  .menu {
    margin-top: 10px;
    font-size: 1.2rem;
  }
}
